Fantastic for fun out side in the sun... the only problem will be ... which one to pick!

It has 3 Basic Essential Features;
1. Fully Adjustable Head size with Pull Tie Cord to adjust the hat to fit to your childs head; 
2. Newly Strengthened Wide Brim to Protect from the Sun;
3. Under Chin Ties to hold the hat on even on Windy Days

Easily made Reversible with the help of a Safety Pin; Attach the pin to the ends of the Cord and Chin Ties THEN Simply Pull the Cord and Chin Ties through to the other side

Available in Sizes;
NB, 3-12mth (50cm), 1-2Yrs (52cm), 2-3Yrs (56cm), 3-5Yrs (58cm), Size- 6-8Yrs (62cm), 8-10Yrs (without chin tie)

Supplier : EJ Kids

NOT AVAILABLE FOR LOCAL PICK UP.

Our supplier is on mini family break... orders will be posted out that following Mon (11th)

